const Popup = ({ L, SL, AccessAllowed, AccessRestricted, onLogin, isOpen, onClose }) => {
    if(!isOpen)
        return null;

        return (
            <div className="popup"> 
                <div className="popup-content">
                    <Login onClose={onClose} />
                </div>
            </div>
        )

}
